import React from "react";
import Header from "./Header"
import {BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
      <Header/>
      <Router>
        <Switch>
          <Route path="/">
            <h1>I am homepage</h1>
          </Route>
          <Route path="/chat">
            <h1>I am the chatpage</h1>
          </Route>

        </Switch>
      </Router>
    </div>
  );
}

export default App;
